import React, { Component } from "react";

const Like = () => {
  return (
    <div>
      <i
        className={"fa fa-heart" + (this.props.liked ? "" : "-o")}
        aria-hidden="true"
        onClick={() => this.props.onLiked(this.props.id)}
      ></i>
    </div>
  );
};

export default Like;
